  false,\n\t\"url\": null,\n\t\"notes\": \"Progress report on the GIS support the
  Upper Midwest Environmental Sciences Center (UMESC) is providing to the U.S. Fish
  and Wildlife Service (FWS) in the development of Comprehensive Conservation Plans
  for six pilot refuges in FWS Regions 3 (Sherburne, Muscatatuck, and Crab Orchard)
  and three in Region 6 (Sand Lake, Arrowwood, and Arapaho).  Specifically, UMESC
  is (1) compiling relevant GIS data layers in an Arc View project for each refuge,
  (2) developing and providing spatial descison support system tools to regional refuge
  planners, refuge staffs, and the USGSCCP Project Team to facilitate the CCP process,
  and (3) assisting with development of land cover/land use and other digital databases
  where needed and as funding permits.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
